export const initialState = {
    mainPosts: [{
        id: 1,
        User: {
            id: 1,
            nickname: '해돋이',
        },
        content: '첫 번째 게시글 #해시태그 #익스프레스',
        Images: [
            { src: 'https://bit.ly/34S7zRp' },
            { src: 'https://bit.ly/3uX6IJH' },
            { src: 'https://bit.ly/2TDFv1w' },
        ],
        Comments: [{
            User: {
                nickname: '재원'
            },
            content: '키보드 윤활해야지~'
        }, {
            User: {
                nickname: '선범'
            },
            content: '여친이랑 산에 가야지~'
        }],
    }],
    imagePaths: [],
    postAdded: false,

}

const reducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state;
    }
};

export default reducer;
